/** @format */

import React, { useState } from "react";
import styled from "styled-components";
import HomeIcon from "@mui/icons-material/Home";
import AnalyticsIcon from "@mui/icons-material/Analytics";
import TrendingUpIcon from "@mui/icons-material/TrendingUp";
import GroupIcon from "@mui/icons-material/Group";
import CategoryIcon from "@mui/icons-material/Category";
import ReceiptLongIcon from "@mui/icons-material/ReceiptLong";
import SummarizeIcon from "@mui/icons-material/Summarize";
import MailIcon from "@mui/icons-material/Mail";
import FeedbackIcon from "@mui/icons-material/Feedback";
import SendIcon from "@mui/icons-material/Send";
import Modal from "@mui/material/Modal";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";

const style = {
	position: "absolute",
	top: "50%",
	left: "50%",
	transform: "translate(-50%, -50%)",
	width: 400,
	bgcolor: "background.paper",
	border: "2px solid #000",
	boxShadow: 24,
	p: 4,
};

const Sidebar = () => {
	const [open, setOpen] = useState(false);
	const handleOpen = () => setOpen(true);
	const handleClose = () => setOpen(false);
	return (
		<Container>
			<Wrapper>
				<Modal
					open={open}
					onClose={handleClose}
					aria-labelledby="modal-modal-title"
					aria-describedby="modal-modal-description"
				>
					{/* <Box sx={style}>
						<Typography id="modal-modal-title" variant="h6" component="h2">
							Text in a modal
						</Typography>
						<Typography id="modal-modal-description" sx={{ mt: 2 }}>
							Duis mollis, est non commodo luctus, nisi erat porttitor ligula.
						</Typography>
					</Box> */}
					<Form>
						<Label>Sprint</Label>
						<Input type="text" name="sprint" placeholder="Sprint"></Input>
						<Label>Sprint</Label>
						<Input type="text" name="sprint" placeholder="Sprint"></Input>
						<Label>Sprint</Label>
						<Input type="text" name="sprint" placeholder="Sprint"></Input>
						<Label>Sprint</Label>
						<Input type="text" name="sprint" placeholder="Sprint"></Input>
						<Label>Sprint</Label>
						<Input type="text" name="sprint" placeholder="Sprint"></Input>
						<Label>Sprint</Label>
						<Input type="text" name="sprint" placeholder="Sprint"></Input>
						<Label>Sprint</Label>
						<Input type="text" name="sprint" placeholder="Sprint"></Input>
						<Label>Sprint</Label>
						<Input type="text" name="sprint" placeholder="Sprint"></Input>
					</Form>
				</Modal>
				<SidebarMenu>
					<Button onClick={handleOpen}>Tracker</Button>
				</SidebarMenu>
				<SidebarMenu>
					<SidebarMenuTile>Dashboard</SidebarMenuTile>
					<SidebarMenuList>
						<SidebarMenuListItem>
							<HomeIcon />
							HOME
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<AnalyticsIcon />
							ANALYTICS
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<TrendingUpIcon />
							SALES
						</SidebarMenuListItem>
					</SidebarMenuList>
				</SidebarMenu>
				<SidebarMenu>
					<SidebarMenuTile>Quick Menu</SidebarMenuTile>
					<SidebarMenuList>
						<SidebarMenuListItem>
							<GroupIcon />
							USERS
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<CategoryIcon />
							PRODUCTS
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<ReceiptLongIcon />
							TRANSACTIONS
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<SummarizeIcon />
							REPORTS
						</SidebarMenuListItem>
					</SidebarMenuList>
				</SidebarMenu>
				<SidebarMenu>
					<SidebarMenuTile>Notifications</SidebarMenuTile>
					<SidebarMenuList>
						<SidebarMenuListItem>
							<MailIcon />
							MAIL
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<FeedbackIcon />
							FEEDBACKS
						</SidebarMenuListItem>
						<SidebarMenuListItem>
							<SendIcon />
							MESSAGES
						</SidebarMenuListItem>
					</SidebarMenuList>
				</SidebarMenu>
			</Wrapper>
		</Container>
	);
};

export default Sidebar;

const Container = styled.div`
	flex: 1;
	border-right: 1px solid lightgray;
	height: calc(100vh - 60px);
	position: sticky;
	top: 60px;
`;
const Wrapper = styled.div`
	padding: 10px;
`;
const SidebarMenu = styled.div`
	margin-bottom: 20px;
`;
const SidebarMenuTile = styled.h1`
	font-size: 18px;
	color: gray;
	font-weight: 300;
	letter-spacing: 2px;
`;
const SidebarMenuList = styled.ul`
	list-style: none;
	margin-top: 10px;
`;
const SidebarMenuListItem = styled.li`
	display: flex;
	align-items: center;
	margin: 10px 0px;
	gap: 5px;
	cursor: pointer;
	border-radius: 5px;
	padding: 5px;
	color: black;
	font-weight: 300;
	font-size: 12px;
	&:hover {
		background-color: #f6e5e5;
	}
`;
const Button = styled.button`
	border: none;
	width: 100%;
	padding: 10px 20px;
	background-color: white;
	cursor: pointer;
	border: 1px solid black;
	border-radius: 10px;
`;
